        void IXmlItem.WriteToXml(
            XElement node,
            ErrorMaskBuilder? errorMask,
            TranslationCrystal? translationMask,
            string? name = null)
        {
            ((PlacedNpcXmlWriteTranslation)this.XmlWriteTranslator).Write(
                item: this,
